import React, { Component } from 'react';

class InfoBlog extends Component {
    render() {
        return (
            <div className="detailblog__infoblog">
                <div className="detailblog__infoblog__img"><img src="image/blog_1.png" alt /></div>
                <div className="detailblog__infoblog__infor">
                    <h2>Vang thang Long classic</h2><span>Đăng bởi Giangle | 30/06/2015 | 60 bình luận</span>
                    <p>
                        Vang nổ Thang Long có hương vị đặc trưng của sản phẩm lên men tự nhiên từ hoa quả với độ
                        rượu nhẹ, bột ga đầy trắng mịn.
                        Van nổ Thăng Long ...
                        Vang nổ Thang Long có hương vị đặc trưng của sản phẩm lên men tự nhiên từ hoa quả với độ
                        rượu nhẹ, bột ga đầy trắng mịn.
                        Van nổ Thăng Long ...
                        Vang nổ Thang Long có hương vị đặc trưng của sản phẩm lên men tự nhiên từ hoa quả với độ
                        rượu nhẹ, bột ga đầy trắng mịn.
                        Van nổ Thăng Long ...
                  </p>
                </div>
            </div>
        );
    }
}

export default InfoBlog;
